import styled from 'styled-components';

const Container = styled.div`
  dispaly: flex;
  flex-direction: column;
  `;
const Header = styled.div`
  display: dispay: flex;
  flex-direction: row;
  background-color: black;
`

function App() {
  return (
    <Container >
      <Header>The Movie Search App</Header>

    </Container>
  );
}

export default App;
